import * as React from "react";
import { useEffect, useState } from "react";
import Contribution from "../components/Contribution/Contribution";
import Header from "../components/Header/Header";
import TimeInput from "../components/TimeInput/TimeInput";
import { getData } from "../utils/getData";
import { Link } from "react-router-dom";
import AnalysisWeek from "./AnalysisWeek";

interface Data {
  date: string;
  improve: {
    study: string;
    workout: string;
    reading: string;
    rest: string;
  };
  private: {
    privates: string;
    game: string;
  };
  sleeping: {
    night: string;
    nap: string;
    wake: string;
    sleep: string;
  };
  working: {
    works: string;
    houseWork: string;
  };
  entireTime: {
    entireImprove: string;
    entirePrivate: string;
    entireWorks: string;
    entireSleep: string;
  };
  id: number;
}

function Dashboard() {
  const [data, setData] = useState(null);

  useEffect(() => {
    getData(setData);
  }, []);
  return (
    <>
      <Header />
      <TimeInput />
      <Contribution data={data} setData={setData} />
      <div>
        <Link to="/analysis-week" state={{ data: data }}>
          <button>주간분석</button>
        </Link>
      </div>
    </>
  );
}

export default Dashboard;
